import { Routes,Route,Link,useNavigate,Outlet } from 'react-router-dom';
// css
import "./reset.css";
import "./App.css";
// component
import Nav from "./components/Nav/Nav";
import Main from "./components/Main/Main";

function App() {
  return (
    <div className="App">
      <Nav />
      <Routes>
        <Route path="/" element={<Main />}></Route>
      </Routes>
    </div>
  );
}

export default App;
